            "groundspeak:short_description": {
              "@html": "True",
              "#text": "<p>The cache is NOT at the posted coordinates. I developed this cache series to share some facts about insects. Most of the answers can be easily googled. Some may take a little additional logic to get right. I hope fellow geocachers find this to be a fun and worthwhile series.</p>\nThis cache is of a small size hidden along a roadway in mid-Missouri - no place special or particularly scenic. If nothing else, consider it an opportunity for a number boost!"
            },
            "groundspeak:long_description": {
              "@html": "True",
              "#text": "<p>To find the coordinates to this cache, you will research answers to questions about the insect order Hymenoptera \u2013 bees, ants, and wasps.</p>\n<p>The final location is at N38 5A.BCD W92 0E.AFG.</p>\n<p>Choose the answer that is correct to fill in the coordinates.</p>\n<div>A. The Hymenoptera could be considered to be most advanced of all insect orders, due to the evolution of eusociality in the ants, bees and wasps. What is the hallmark of eusociality?<br />\n<blockquote>cooperative brood care = 4<br />\noverlapping generations of adults = 5<br />\nreproductive and non-reproductive caste system = 6<br />\nall of the above = 7<br /></blockquote>\n</div>\n<div>B. What is a \u201ccow killer\u201d?<br />\n<div>\n<blockquote>ant = 0<br />\nbee = 1<br />\nwasp = 2<br />\n<br /></blockquote>\n</div>\n<div>C. \u201cPhase IV\u201d was a movie made in 1974. What hymenopterans are the \u201cvillains\u201d in this film?</div>\n<div>\n<blockquote>bees = 3<br />\n<div>ants = 4<br />\n<div>wasps = 5<br />\n<div>sawflies = 6<br /></div>\n</div>\n</div>\n</blockquote>\n</div>\n<div>D. Larvae of <i>Perga affinis</i>, an Australian sawfly, uses what tactic as a defense against predators?</div>\n<div>\n<blockquote>\u201dspitting\u201d an odorous green liquid = 6<br />\n<div>ejecting small stinging hairs = 7<br />\n<div>inflicting bites with their 2 inch mandibles = 8<br />\n<div>pulling their heads into a shell = 9<br /></div>\n</div>\n</div>\n</blockquote>\n</div>\n<div>E. The so-called \u201ckiller bee\u201d, a.k.a the Africanized honey bee, <i>Apis mellifera scutellata</i>, was accidentally released into the wild in the western hemisphere in what country?</div>\n<div>\n<blockquote>Cuba = 2<br />\n<div>Panama = 3<br />\n<div>Barbados = 4<br />\n<div>Brazil = 5<br /></div>\n</div>\n</div>\n</blockquote>\n</div>\n<div>F. Honey bees are one of the most economically significant insects on earth. In addition to their production of honey, wax, pollen, and their impact on pollination of flowering plants, one of their products can be used to make an alcoholic beverage known as?</div>\n<div>\n<blockquote>kombucha = 2<br />\n<div>mead = 3<br />\n<div>sambuca = 4<br />\n<div>nalewka = 5<br /></div>\n</div>\n</div>\n</blockquote>\nG = 0</div>\n<br />\n<div>\n<div>You are looking for a camouflaged pill bottle. I boiled and washed out the bottle myself - so no worries on the pharmaceutical residues!</div>\n<br />\n<p>You can check your answers for this puzzle on <a href=\"http://www.geochecker.com/index.php?code=824114d25cb9791191d6eeec09a1713d&amp;action=check&amp;wp=4743364650444d&amp;name=48796d656e6f7074657261\">GeoChecker.com</a>.</p>\n</div>\n</div>\n\n<p>Additional Waypoints</p>"
            },
