                  "groundspeak:text": {
                    "@encoded": "False",
                    "#text": "Something's Bugging Me . . . #6 (6:44 PM)\n\nThe rough country road wound around wooded banks until I drove out into the open.  Whew!  Telltale signs of agriculture then surged on either side of the car heralding my arrival.  Birds sang, and clouds danced high up in the sky.\n\n. . . Perhaps approaching the coordinates wasn't really that grandiose.  [:P]  In any case, I arrived with some measure of trepidation.  Knowing when to have an excuse ready is the hallmark of an experienced geocacher.  With GPS pointing the way, the hunt was on!\n\nSearching for this bugger was tricky.  I poked, prodded and generally annoyed everything within a twenty-five foot radius.  An idea struck, and, feeling around, the cache was in hand.  Nicely done yet again!  The cache owner kept me on my toes during this outing; I like that.  With a sign and replace, I continued on."
                  }
