            "groundspeak:short_description": {
              "@html": "True",
              "#text": "<p>The cache is NOT at the posted coordinates. This is part of the second wave of a cache series I\u2019m using to quiz cachers about insects, and hopefully spread some knowledge. Most of the answers can be easily googled. Some may take a little additional logic to get right. I hope fellow geocachers find this to be a fun and worthwhile series.</p>\nCaches are in a final location that is no place special or particularly scenic. If nothing else, consider it an opportunity for a number boost!"
            },
            "groundspeak:long_description": {
              "@html": "True",
              "#text": "<p>To find the coordinates to this cache, you will research answers to questions about the insect order Orthoptera \u2013 grasshoppers, crickets, and katydids.</p>\n<p>The final location is at N38 5A.BAC W92 0D.EEB.</p>\n<p>Choose the answer that is correct to fill in the coordinates.</p>\n<div>A. What kind of insect is the bad guy in \"The Miracle of the Gulls\"?<br />\n<blockquote>grasshopper = 6<br />\ncricket = 8<br />\nmole cricket = 8<br />\nkatydid = 9<br /></blockquote>\n</div>\n<div>B. One of the following has never been a common name of an orthopteran. But which?<br />\n<div>\n<blockquote>Crackling Locust = 0<br />\nFurnace Heat Lubber = 1<br />\nRobust Monkey Grasshopper = 2<br />\nJerusalem Cricket = 3<br />\nGreat Grig = 4<br />\nJade-striped Sylph= 5<br />\nCarlinian Snapper= 6<br />\nCarolina Leaf-roller= 6<br />\nAztec Spur-throat= 8<br />\nSword-bearing Conehead= 9<br /></blockquote>\n</div>\n<div>C. OK, I'm just going to give you this one. But first, I want you to google \"Cooloola monster\".</div>\n<div>\n<blockquote>C = 0<br /></blockquote>\n</div>\n</div>\n<div>D. Under ideal environmental conditions, several generations of <i>Schistocerca gregaria</i> can be produced in a very short period of time, leading to destructive swarms of this insect that can cover as much as 20% of the earth's land surface. What is the common name of this pest?</div>\n<div>\n<blockquote>Migratory locust = 5<br />\n<div>Rocky Mountain locust = 6<br />\n<div>Desert locust = 7<br />\n<div>Pharoah locust = 8<br /></div>\n</div>\n</div>\n</blockquote>\n</div>\n<div>E. Males of a particular type of orthopteran construct exponential horn-shaped burrows. They use these burrows for \"singing\" to attract a mate, and the sound can reach a peak of 115 dB. What type of insect is this?\n<div>\n<blockquote>Mormon Cricket = 5\n<div>mole cricket = 6\n<div>pygmy mole cricket = 7\n<div>giant weta = 8<br /></div>\n</div>\n</div>\n</blockquote>\n</div>\n<div>\n<div>You are looking for a camouflaged match stick container. It is within a few millimeters of being invisible. PLEASE hide it back the way you found it to preserve the difficulty of the hide</div>\n<br />\n<p>You can check your answers for this puzzle on <a href=\"http://www.geochecker.com/index.php?code=494971ae0b128949a33ea71e4a84fefe&amp;action=check&amp;wp=47433647303142&amp;name=4f7274686f7074657261\">GeoChecker.com</a>.</p>\n</div>\n</div>\n\n<p>Additional Waypoints</p>"
            },
