                    "#text": "Something's Bugging Me . . . #5 (6:29 PM)\n\nSome measure of stealth was apparent upon arrival to this cache.  Saying why might spoil things; suffice it to say, I was quiet and attentive while parking.  A short walk brought me to the coordinates for a swift find, sign and replace.  I left as silently as I had arrived like a whisper on the wind.  The only trace of my visit was a signature.  [|)]"
