            "groundspeak:state": "Missouri",
            "groundspeak:short_description": {
              "@html": "True",
              "#text": "<p>The cache is NOT at the posted coordinates. This is part of the second wave of a cache series I\u2019m using to quiz cachers about insects, and hopefully spread some knowledge. Most of the answers can be easily googled. Some may take a little additional logic to get right. I hope fellow geocachers find this to be a fun and worthwhile series.</p>\nCaches are in a final location that is no place special or particularly scenic. If nothing else, consider it an opportunity for a number boost!"
            },
            "groundspeak:long_description": {
              "@html": "True",
              "#text": "<p>To find the coordinates to this cache, you will research answers to questions about the insect order Psocodea \u2013 barklice, booklice, and \"true\" lice.</p>\n<p>The final location is at N38 5A.BCD W92 0D.ADE.</p>\n<p>Choose the answer that is correct to fill in the coordinates.</p>\n<div>A. The barklice and booklice are tiny, ineffectual creatures that humans rarely come in contact with. What is their primary food?<br />\n<blockquote>paper, books, and ink = 7<br />\nfungi, algae, lichens = 8<br />\ndecaying animal matter = 9<br />\nraspberries = 0<br /></blockquote>\n</div>\n<div>B. Entomologists once considered the true lice to be a separate order from the booklice and barklice. Being incapable of leaving well-enough alone, though, systematists have reclassified the true lice as being evolutionarily descended from other psocodeans, and thus part of the order. What was the name of the order that formerly contained the true lice?<br />\n<div>\n<blockquote>Phtheraptira = 0<br />\nPhthiraptera = 1<br />\nPhtireptira = 2<br />\nPthiraphtera = 3<br /></blockquote>\n</div>\n<div>C. The true lice are obligate parasites of warm-blooded animals. Their hosts include every species of bird and mammal except monotremes, pangolins, bats, and cetaceans. What are monotremes?</div>\n<div>\n<blockquote>Kangaroos and wallabies = 6<br />\n<div>Voles and flying foxes= 5<br />\n<div>Spiny anteaters and the platypus = 0<br />\n<div>Aardvarks and aardwolves= 4<br /></div>\n</div>\n</div>\n</blockquote>\n</div>\n<div>D. The human body louse, <i>Pediculus humanus humanus</i>, vectors the pathogen <i>Rickettsia prowazekii</i> (I love Latin binomials!). The pathogen lives in the louse gut, and is subsequently excreted onto the host, which then scratches the louse bite, thus infecting itself by rubbing the pathogen into the bite wound. What disease does <i>R. prowazekii</i> cause?</div>\n<div>\n<blockquote>scrub typhus = 5<br />\n<div>murine typhus = 6<br />\n<div>epidemic typhus = 7<br />\n<div>type O typhus = 8<br /></div>\n</div>\n</div>\n</blockquote>\n</div>\n<div>E. What is special about the Echinophthiriidae?</div>\n<div>\n<blockquote>last word spelled correctly in the 2013 National Spelling Bee = 0<br />\n<div>offered by native Siberians as a marriage offering= 1<br />\n<div>only barklice that spin silken galleries = 6<br />\n<div>only insects that infest aquatic hosts = 9<br /></div>\n</div>\n</div>\n</blockquote>\n</div>\n<div>\n<div>You are looking for a small camouflaged container, about 1 cubic inch in size. You will probably need a TOTT to retrieve the log. Also, there ain't much log, so write small. Finally PLEASE replace EXACTLY as found to preserve the difficulty of the hide.</div>\n<br />\n<p>You can check your answers for this puzzle on <a href=\"http://www.geochecker.com/index.php?code=0999bc8026eee06ba9fe6f19a30c88db&amp;action=check&amp;wp=47433647314347&amp;name=50736f636f646561\">GeoChecker.com</a>.</p>\n</div>\n</div>\n\n<p>Additional Waypoints</p>"
            },
