            "groundspeak:short_description": {
              "@html": "True",
              "#text": "<p>The cache is NOT at the posted coordinates. I developed this cache series to share some facts about insects. Most of the answers can be easily googled. Some may take a little additional logic to get right. I hope fellow geocachers find this to be a fun and worthwhile series.</p>\nThis cache is of a small size hidden along a roadway in mid-Missouri - no place special or particularly scenic. If nothing else, consider it an opportunity for a number boost!"
            },
            "groundspeak:long_description": {
              "@html": "True",
              "#text": "<p>This cache asks questions about the taxonomic order Coleoptera, a.k.a, beetles!</p>\n<p>The final location is at N38 5A.BCA W92 1D.EAB.</p>\n<p>Choose the answer that is correct to fill in the coordinates.</p>\n<div>A. The beetles are the most diverse single taxon on earth. Approximately what percentage of all species of life do beetle species represent?<br />\n<blockquote>90% = 6<br />\n75% = 7<br />\n50% = 8<br />\n25% = 9<br /></blockquote>\n</div>\n<div>B. According to the American Institute of Biological Sciences, certain beetles save the United States cattle industry an estimated US$380 million annually through burying above-ground livestock feces. What is the common name of these remarkable insects?<br />\n<div>\n<blockquote>ground beetle = 3<br />\nbombardier beetle = 4<br />\ndung beetle = 5<br />\nironclad beetle = 6<br /></blockquote>\n</div>\n<div>C. \"What can be inferred about the Creator by examining His Creation?\" \"An inordinate fondness for beetles.\" This (probably apocryphal) reply to a question from a theologian was delivered by a 20th century scientist who later would abandon his home country and become a naturalized citizen of another due to political dissent. What were the two countries in question?</div>\n<div>\n<blockquote>USA and Brazil= 1<br />\n<div>Russia and USA= 2<br />\n<div>Iceland and UK= 3<br />\n<div>UK and India= 4<br /></div>\n</div>\n</div>\n</blockquote>\n</div>\n<div>D. What is the largest beetle?</div>\n<div>\n<blockquote>Sabertooth Longhorn Beetle = 7<br />\n<div>Goliath Beetle = 8<br />\n<div>Titan Beetle = 9<br />\n<div>All of the above can claim the title, depending on what criterion is used = 0<br /></div>\n</div>\n</div>\n</blockquote>\n</div>\n</div>\n<div>E. According to research published in the American Journal of Enology and Viticulture (2004), what beetle has been found to contaminate grapes and change the taste of wine?</div>\n<div>\n<blockquote><i>Calosoma scrutator</i> = 0<br />\n<div><i>Harmonia axyridis</i> = 1<br />\n<div><i>Hydroscapha natans</i> = 2<br />\n<div><i>Cupes capitatus</i> = 3<br /></div>\n</div>\n</div>\n</blockquote>\n</div>\n<div>You're looking for a small black magnetic lump. Have fun!</div>\n<br />\n<div>\n<p>You can check your answers for this puzzle on <a href=\"http://www.geochecker.com/index.php?code=65dd8998c779e8c53d46446d26cbe4d4&amp;action=check&amp;wp=47433646433546&amp;name=436f6c656f7074657261\">GeoChecker.com</a>.</p>\n</div>\n\n<p>Additional Waypoints</p>"
            },
