                    "#text": "A = 9\nB = 5\nC = 4\nD = 0\nE = 1\n\nN38 5A.BCA W92 1D.EAB\nN38 59.549 W92 10.195\n\n\u00b7 Coleoptera (GC6FC5F) \u00b7\nN 38\u00b0 59.549  W 92\u00b0 10.195\n\nSuccess!\n\nWhoohoo! Yipee! uh-huh, uh-huh! w00t! Yeah, baby!\n\nNow, go get it!"
