                    "#text": "Something's Bugging Me . . . #3 (6:07 PM)\n\nGrrr!  Finding the cache was no problem at all; however, opening the sucker was incredibly difficult.  Various tools in the car did little to budge the lid.  Persistence seemed to pay off after some coaxing and steady pressure.  The log was signed, and the cache as closed lightly to save the next finder from the same agony.  [:P]"
