            "groundspeak:state": "Missouri",
            "groundspeak:short_description": {
              "@html": "True",
              "#text": "<p>The cache is NOT at the posted coordinates. I developed this cache series to share some facts about insects. Most of the answers can be easily googled. Some may take a little additional logic to get right. I hope fellow geocachers find this to be a fun and worthwhile series.</p>\nThis cache is of a small size hidden along a roadway in mid-Missouri - no place special or particularly scenic. If nothing else, consider it an opportunity for a number boost!"
            },
            "groundspeak:long_description": {
              "@html": "True",
              "#text": "<p>To find the coordinates to this cache, you will research answers to questions about a group of insects known as the Neuropterida. The Neuropterida comprise 3 orders: the Megaloptera, (dobsonflies, fishflies, and alderflies); the Neuroptera (lacewings, antlions, and owlflies), and the Raphidioptera (snakeflies). While the Neuroptera and Raphidioptera are also interesting, I decided to make all of the questions about the Megaloptera. The cache log also bears the name \"Megaloptera\", not \"Neuropterida\", fyi.</p>\n<p>The final location is at N38 5A.BBC W92 1D.EFG.</p>\n<p>Choose the answer that is correct to fill in the coordinates.</p>\n<div>A. The name of the order, Megaloptera, means?<br />\n<blockquote>terminal spike = 5<br />\nsheath wing = 6<br />\nangel wing = 7<br />\nlarge wing = 8<br /></blockquote>\n</div>\n<div>B. Male dobsonflies bear an impressive pair of mandibles. What is their purpose?<br />\n<div>\n<blockquote>to facilitate mating = 6<br />\nto dig specialized egg-laying channels = 7<br />\nas gyroscopic control during flight= 8<br />\nto envenomize prey = 9<br /></blockquote>\n</div>\n<div>C. A hellgrammite is?</div>\n<div>\n<blockquote>a larval dobsonfly = 6<br />\n<div>a supervillain in the DC comics universe = 7<br />\n<div>a type of fish bait = 8<br />\n<div>all of the above = 9<br /></div>\n</div>\n</div>\n</blockquote>\n</div>\n<div>D. An easy one: (A-B)-2 =</div>\n<div>\n<blockquote>0 = 0<br />\n<div>1 = 1<br />\n<div>2 = 2<br />\n<div>3 = 3<br /></div>\n</div>\n</div>\n</blockquote>\n</div>\n<div>E. The Megaloptera undergo the most primitive form of what biological process?</div>\n<div>\n<blockquote>diurnal set-pointing = 2<br />\n<div>complete metamorphosis = 3<br />\n<div>Cisuralian atropism = 4<br />\n<div>vacillating pupation = 5<br /></div>\n</div>\n</div>\n</blockquote>\n</div>\n<div>F. In 2014, in Chengdu, Sichuan province (China) the largest known Megalopteran specimen was recently discovered. What was its wingspan?</div>\n<div>\n<blockquote>3.3 inches = 3<br />\n<div>5.8 inches = 4<br />\n<div>8.3 inches = 5<br />\n<div>9.2 inches = 6<br /></div>\n</div>\n</div>\n</blockquote>\n</div>\n<div>Finally, G = (E+F)/2</div>\n<br />\n<div>\n<div>You are looking for a camouflaged pill bottle. I boiled and washed out the bottle myself - so no worries on the pharmaceutical residues!</div>\n<br />\n<p>You can check your answers for this puzzle on <a href=\"http://www.geochecker.com/index.php?code=01268607fa94622dc77030c4e9c7ce5e&amp;action=check&amp;wp=4743364637524a&amp;name=4d6567616c6f7074657261\">GeoChecker.com</a>.</p>\n</div>\n</div>\n\n<p>Additional Waypoints</p>"
            },
