            "groundspeak:short_description": {
              "@html": "True",
              "#text": "<p>The cache is NOT at the posted coordinates. I developed this cache series to share some facts about insects. Most of the answers can be easily googled. Some may take a little additional logic to get right. I hope fellow geocachers find this to be a fun and worthwhile series.</p>\nThis cache is of a small size hidden near a roadway in mid-Missouri - no place special or particularly scenic. If nothing else, consider it an opportunity for a number boost!"
            },
            "groundspeak:long_description": {
              "@html": "True",
              "#text": "<p>This cache asks questions about the taxonomic class of the insects, a.k.a, Insecta.</p>\n<p>The final location is at N38 5A.BCB W92 1D.DEF.</p>\n<p>Choose the answer that is correct to fill in the coordinates.</p>\n<div>A. The number of species of insects on earth is what approximate percentage of all animal species?<br />\n<blockquote>30% = 5<br />\n50% = 6<br />\n70% = 7<br />\n90% = 8<br /></blockquote>\n</div>\n<div>B. Which of the following statements is true?<br />\n<div>\n<blockquote>All insects are bugs. = 3<br />\nAll bugs are insects. = 5<br /></blockquote>\n</div>\n<div>C. All insects have three tagmata. What are they?</div>\n<div>\n<blockquote>front, middle, and hind legs = 2<br />\n<div>head, thorax, abdomen = 3<br />\n<div>egg, nymph, adult = 4<br />\n<div>mandible, maxilla, labium = 5<br /></div>\n</div>\n</div>\n</blockquote>\n</div>\n<div>D. An easy one: The first letter for the taxonomic class that the insects belong to looks similar to this number</div>\n<div>\n<blockquote>0 = 0<br />\n<div>1 = 1<br />\n<div>2 = 2<br />\n<div>5 = 5<br /></div>\n</div>\n</div>\n</blockquote>\n</div>\n<div>E. This one is a little harder: Hexapoda is the subphylum that includes the insects. As the name implies, hexapods have 3 pair of legs. At one time, scientists considered all hexapods to be insects. Molecular and DNA evidence have since caused a revision to hexapod systematics. How many \"groups\" of hexapods, were once considered to be insects?</div>\n<div>\n<blockquote>2 = 4<br />\n<div>3 = 6<br />\n<div>4 = 8<br />\n<div>5 = 0<br /></div>\n</div>\n</div>\n</blockquote>\n</div>\n<div>F. The University of Missouri here in Columbia has an entomology club. It is named after a famous entomologist. How did this namesake scientist die?</div>\n<div>\n<blockquote>Stung to death by bees = 6<br />\n<div>Killed by bandits in Ecuador = 7<br />\n<div>After a years-long struggle with African Sleeping Sickness = 8<br />\n<div>Head trauma following a bicycle accident = 9<br /></div>\n</div>\n</div>\n</blockquote>\n</div>\n<div>You are looking for a camouflaged spice bottle. It had black peppercorns in it and it still smells like pepper!</div>\n<br />\n<div>You can check your answers for this puzzle on <a href=\"http://www.geochecker.com/index.php?code=0ef8962fae0c6642139701808b6dd3f8&amp;action=check&amp;wp=47433559453842&amp;name=496e7365637461&amp;visitcount=1\">GeoChecker.com</a>.</div>\n</div>\n\n<p>Additional Waypoints</p>"
            },
