                    "#text": "From Old Professor 4/15/2016: N38 57.535 W092 11.149\n\n====\n\nA = 8\nB = 5\nC = 3 (Collembola, Protura, Diplura)\nD = 1 (Insecta)\nE = (3) = 6\nF = 9 (ran into a granite block on his bicycle)\n\nN38 58.535 W92 11.169\n\n\u00b7 Insecta (GC5YE8B) \u00b7\nN 38\u00b0 58.535  W 92\u00b0 11.169\n\nSuccess!\n\nWhoohoo! Yipee! uh-huh, uh-huh! w00t! Yeah, baby!\n\nNow, go get it!"
