            "groundspeak:long_description": {
              "@html": "True",
              "#text": "<p>This cache asks questions about the taxonomic order Diptera, a.k.a, the true flies.</p>\n<p>The final location is at N38 5A.BCC W92 1D.EFB.</p>\n<p>Choose the answer that is correct to fill in the coordinates.</p>\n<div>A. Diptera are so named because?<br />\n<blockquote>they have only 2 eyes = 5<br />\nthey have only 2 \u201cflight\u201d wings = 6<br />\nthey have only 2 hind legs = 7<br />\ntheir flight has a characteristic \u201cdip\u201d = 8<br /></blockquote>\n</div>\n<div>B. The little scuttle fly, <i>Megaselia scataris</i>, has been reared from which of the following?<br />\n<div>\n<blockquote>decaying vegetation. = 5<br />\nlung tissue of living people. = 6<br />\nshoe polish. = 7<br />\nall of the above. = 8<br /></blockquote>\n</div>\n<div>C. Mosquitoes (family Culicidae) are perhaps the most medically important insect on Earth. Which of the following diseases do mosquitoes not vector?</div>\n<div>\n<blockquote>dengue fever = 5<br />\n<div>malaria = 6<br />\n<div>chronic wasting disease = 7<br />\n<div>pogosta disease = 8<br /></div>\n</div>\n</div>\n</blockquote>\n</div>\n<div>D. What dipteran body part contains a region known as the alula?</div>\n<div>\n<blockquote>abdomen = 0<br />\n<div>antennae = 1<br />\n<div>wings = 2<br />\n<div>mouth = 3<br /></div>\n</div>\n</div>\n</blockquote>\n</div>\n<div>E. Flies in the family Nemestrinidae are endoparasitoids (meaning their young develop inside the host and kill the host upon emergence) of what 2 other insect types?</div>\n<div>\n<blockquote>fleas and lice = 6<br />\n<div>flies and ground beetles = 7<br />\n<div>bats and moles = 8<br />\n<div>grasshoppers and scarab beetles = 9<br /></div>\n</div>\n</div>\n</blockquote>\n</div>\n<div>F. \u201cThey'll see and they'll know, and they'll say, 'Why, she wouldn't even harm a fly.\u201d This line is from a famous movie by an even more famous director. Who?</div>\n<div>\n<blockquote>Stanley Kubrick = 4<br />\n<div>Alfred Hitchcock = 5<br />\n<div>Gus Van Sant = 6<br />\n<div>Lars von Trier = 7<br /></div>\n</div>\n</div>\n</blockquote>\n</div>\n<div>You are looking for a camouflaged pill bottle. I boiled and washed out the bottle myself - so no worries on the pharmaceutical residues!</div>\n<br />\n<p>You can check your answers for this puzzle on <a href=\"http://www.geochecker.com/index.php?code=9ddcc38deffe9a20ee1e664838805c64&amp;action=check&amp;wp=47433646433654&amp;name=44697074657261\">GeoChecker.com</a>.</p>\n</div>\n\n<p>Additional Waypoints</p>"
            },
