            "groundspeak:state": "Missouri",
            "groundspeak:short_description": {
              "@html": "True",
              "#text": "<p>The cache is NOT at the posted coordinates. This is part of the second wave of a cache series I\u2019m using to quiz cachers about insects, and hopefully spread some knowledge. Most of the answers can be easily googled. Some may take a little additional logic to get right. I hope fellow geocachers find this to be a fun and worthwhile series.</p>\nCaches are in a final location that is no place special or particularly scenic. If nothing else, consider it an opportunity for a number boost!"
            },
            "groundspeak:long_description": {
              "@html": "True",
              "#text": "<p>To find the coordinates to this cache, you will research answers to questions about the insect order Thysanoptera \u2013 the thrips!</p>\n<p>The final location is at N38 5A.BCD W92 1E.AFE.</p>\n<p>Choose the answer that is correct to fill in the coordinates.</p>\n<div>A. The Thysanoptera are known as the thrips. What is the singular form of the word thrips?<br />\n<blockquote>trice = 4<br />\nthrip = 5<br />\nthrips = 6<br />\nthripe = 7<br /></blockquote>\n</div>\n<div>B. Tomato Spotted Wilt Virus (TSWV) is a plant disease vectored by thrips. What genus of virus is the causative agent in TSWV?<br />\n<div>\n<blockquote>Tospovirus = 0<br />\nTeschovirus = 1<br />\nTremovirus = 2<br /></blockquote>\n</div>\n<div>C. True or false - some species of thrips have evolved eusociality, similar to ants, bees, or termites.</div>\n<div>\n<blockquote>True = 2<br />\n<div>False = 3<br /></div>\n</blockquote>\n</div>\n</div>\n<div>D. All known genera of the thrips are capable of parthenogenesis, a reproductive strategy where unfertilized embryos can develop into adults. In some cases, the unfertilized embryos produce all male individuals; in others all female. What is the all-female form of parthenogenesis called?</div>\n<div>\n<blockquote>Arrhenotoky = 0<br />\n<div>Autotoky = 2<br />\n<div>Epitoky = 4<br />\n<div>Thelytoky = 8<br /></div>\n</div>\n</div>\n</blockquote>\n</div>\n<div>E. What is a Thunderbug?</div>\n<div>\n<blockquote>A British all-girl band circa 1999 = 0<br />\n<div>The mascot of the NHL's Tampa Bay Lightning = 1<br />\n<div>One of many common names for thrips = 2<br />\n<div>All of the above = 3<br /></div>\n</div>\n</div>\n</blockquote>\n</div>\n<div>F. Giving you this one.</div>\n<div>\n<blockquote>F = 1<br /></blockquote>\n</div>\n<div>\n<div>You are looking for a camouflaged tube.</div>\n<br />\n<p>You can check your answers for this puzzle on <a href=\"http://www.geochecker.com/index.php?code=969291b66de25008d4327ad57a5718ed&amp;action=check&amp;wp=47433647375459&amp;name=54687973616e6f7074657261\">GeoChecker.com</a>.</p>\n</div>\n\n<p>Additional Waypoints</p>"
            },
