                  "groundspeak:text": {
                    "@encoded": "False",
                    "#text": "Something's Bugging Me . . . #2 (5:05 PM)\n\nGravel dust clouds settled as my vehicle came to a halt.  Exiting the car, I looked at where the GPS pointed.  Hmmm . . . now this might be a bit challenging!  The hide itself was fairly straightforward; however, a nearby house required a small measure of stealth in order to retrieve the container.  All was completed as planned with nary a notice from the residence.  [:)]  With a sign and replace, I continued on my way."
                  }
