            "groundspeak:long_description": {
              "@html": "True",
              "#text": "<p>To find the coordinates to this cache, you will research answers to questions about the insect order Dermaptera \u2013 the earwigs!</p>\n<p>The final location is at N38 5A.ABC W92 1A.DEF.</p>\n<p>Choose the answer that is correct to fill in the coordinates.</p>\n<div>A. Earwigs are known to practice rudimentary brood care, a type of behavior known as \u201csubsociality\u201d. The mother typically remains in the burrow with the eggs while they hatch and the nymphs develop. This brood care lasts only one or two molts, however, because ?<br />\n<blockquote>the mother dies = 1<br />\nthe mother leaves once the young are sexually mature = 2<br />\nthe mother will eat the young after the second molt = 3<br /></blockquote>\n</div>\n<div>B. Some earwigs are ectoparasites of what mammalian groups?<br />\n<div>\n<blockquote>Elephants and weasels = 0<br />\nBats and rats = 9<br />\nRhymenocerus and hiphoppopotomus = 8<br /></blockquote>\n</div>\n<div>C. The common name \u201cearwig\u201d is derived from?</div>\n<div>\n<blockquote>(a) The fact that earwigs enters the ears of humans and lays its eggs = 4<br />\n<div>(\u00df) The shape of their hind wings = 5<br />\n<div>(?) The belief that earwigs enters the ears of humans and lays its eggs = 6<br />\n<div>(d) \u00df and ? above = 7<br /></div>\n</div>\n</div>\n</blockquote>\n</div>\n<div>D. The St. Helena giant earwig <i>Labidura herculeana</i> is the largest earwig ever collected, reaching 78 mm (about 3 inches). It is now feared extinct. A commemorative stamp was issued in 1982 in honor of this insect. What continent is St. Helena Island nearest to?</div>\n<div>\n<blockquote>North America = 0<br />\n<div>South America = 1<br />\n<div>Africa = 2<br />\n<div>Antarctica = 3<br /></div>\n</div>\n</div>\n</blockquote>\n</div>\n<div>E. Earwigs have a characteristic forceps-like set of \u201cpincers\u201d at the terminus of their abdomen, used in mating (not for defense by pinching; although a pinch may occur, it\u2019s unlikely to cause pain). What is the proper term for these pincers?</div>\n<div>\n<blockquote>acutolobus = 0<br />\n<div>cerci = 1<br />\n<div>precogs = 2<br />\n<div>raspberries = 3<br /></div>\n</div>\n</div>\n</blockquote>\n</div>\n<div>F. If I had a pet earwig, what would I name it?</div>\n<div>\n<blockquote>Archie = 1<br />\n<div>Esther = 2<br />\n<div>Dwayne = 3<br />\n<div>All of the above would be awesome names for a pet earwig! = 4<br /></div>\n</div>\n</div>\n<div><br />\n<p>You can check your answers for this puzzle on <a href=\"http://www.geochecker.com/index.php?code=79bcc75b8380c9d8411ee7f78e91270c&amp;action=check&amp;wp=47433647473731&amp;name=4465726d617074657261\">GeoChecker.com</a>.</p>\n</div>\n</blockquote>\n</div>\n</div>\n\n<p>Additional Waypoints</p>"
            },
