                    "#text": "The wife needed to do some shopping in Columbia today, and I decided to try for a couple of caches.   I have had most of the finals figured out on the entomology caches, but  a couple I went to the seeds scared me so will wait until after a frost to go after them.  This was a neat container (gets a favorite point for ingenuity on it).  The cache is in good order and all is well.  TFTC.\nOld Professor - Tipton, Mo.'"
