                    "@encoded": "False",
                    "#text": "What a great find to break a long streak of no geocaching! It had been a while since *A. davidii* and I had found one, so before we headed over to a friends house for some Dungeons & Dragons I suggested we try to find this one (since it WAS Get Outdoors Day, after all). As we pulled up to GZ I realized that we had made a fatal mistake: *we forgot a pen*. We decided to find it anyway. We got a good laugh from the hide itself, I'm sure it's startled a few. We left a flower in the hide temporarily to prove our presence. I plan to stop by after work one day this week to put our names on the physical log. TFTC!"
