                    "@encoded": "False",
                    "#text": "Well Rats I didnt get FTF but I did get a smiley.  Waa told by the CO this was coming out but when it published so late at night on a school night I knew it would have to wait until today.  When I got up this morning I saw Unitzoid had logged it about the time I woke up.  Darn early bird got the worm and all I got was a ratty STF.   TFTC"
