            "groundspeak:country": "United States",
            "groundspeak:state": "Missouri",
            "groundspeak:short_description": {
              "@html": "True",
              "#text": "<p>The cache is NOT at the posted coordinates. I developed this cache series to share some facts about insects. Most of the answers can be easily googled. Some may take a little additional logic to get right. I hope fellow geocachers find this to be a fun and worthwhile series.</p>\nThis cache is of a small size hidden along a roadway in mid-Missouri - no place special or particularly scenic. If nothing else, consider it an opportunity for a number boost!"
            },
            "groundspeak:long_description": {
              "@html": "True",
              "#text": "<p>To find the coordinates to this cache, you will research answers to questions about the insect order Dictyoptera \u2013 roaches, termites, and mantids.</p>\n<p>The final location is at N38 5A.BAC W92 1D.EFE.</p>\n<p>Choose the answer that is correct to fill in the coordinates.</p>\n<div>A. Mantids, termites and cockroaches were once considered three different orders of insects (some authorities still consider the mantids separate from the cockroaches+termites). Similarities in egg structure and egg cases across the three groups provide compelling evidence that they share a common ancestor, which is part of the reason for the combining of the three taxa into one order. What is the correct term for a mantid or cockroach egg case?<br />\n<div>\n<blockquote>stramineus = 6<br />\nvacuole = 7<br />\ngnomon = 8<br />\nootheca = 9<br /></blockquote>\n</div>\n<div>B. What faith does Zorak the mantis claim to be?<br />\n<div>\n<blockquote>Pentecostal = 0<br />\nUnitarian = 1<br />\nEpiscopalian= 2<br /></blockquote>\n</div>\n<div>C. Female termite queens are the longest-lived of any insect. They can survive up to how many years?</div>\n<div>\n<blockquote>10 = 2<br />\n<div>25 = 3<br />\n<div>50 = 4<br />\n<div>100 = 5<br /></div>\n</div>\n</div>\n</blockquote>\n</div>\n<div>D. The greatest natural enemy to termites are insects in another order that are often (incorrectly) believed to be closely related to termites. Name this group of insects.</div>\n<div>\n<blockquote>wasps = 5<br />\n<div>ants = 6<br />\n<div>mantids = 7<br />\n<div>jumping bristletails = 8<br /></div>\n</div>\n</div>\n</blockquote>\n</div>\n<div>E. Among the most remarked upon aspects of mantis behavior is cannibalism, particularly of a male while mating with a female. In nature, approximately what percent of male mantises meet this fate?</div>\n<div>\n<blockquote>10 = 6<br />\n<div>25 = 8<br />\n<div>50 = 9<br />\n<div>90 = 7<br /></div>\n</div>\n</div>\n</blockquote>\n</div>\n<div>F. The Madagascar hissing cockroach (<i>Gromphadorhina portentosa</i>), has as many as three distinct hisses; disturbance, mating, and aggression. How is this hissing produced?</div>\n<div>\n<blockquote>air forced out from the spiracles = 0<br />\n<div>air drawn in through the spiracles = 1<br />\n<div>air forced out from the mouth = 2<br />\n<div>air drawn in through the mouth = 3<br /></div>\n</div>\n</div>\n<br />\n<div>\n<div>You are looking for a camouflaged matchstick container.</div>\n<br />\n<p>You can check your answers for this puzzle on <a href=\"http://www.geochecker.com/index.php?code=851258edbd077d0c7fc519d7873a5fc6&amp;action=check&amp;wp=4743364735504a&amp;name=44696374796f7074657261\">GeoChecker.com</a>.</p>\n</div>\n</blockquote>\n</div>\n</div>\n</div>\n\n<p>Additional Waypoints</p>"
            },
