            "groundspeak:short_description": {
              "@html": "True",
              "#text": "<p>This cache will take you to a little cemetery forgotten by the passing of time. Rocky Fork Cemetery was started in 1821 and is located in Hinton, MO north of Columbia off Highway VV. It is a small, quiet resting place for many old residents of Boone County from early settlers, merchants, and businessmen to Confederate soldiers. Take time to wander the cemetery and read all the moss covered headstones. Truly a wonderful part of our local history.</p>"
            },
            "groundspeak:long_description": {
              "@html": "True",
              "#text": "<p>This cache is a medium sized container with a log book and plenty of room for trinkets and trackables. BYOP. As you park in the church lot near the highway just take a stroll through the cemetery noting all the old dates and neat headstones. You are looking for a rather plain and lonely headstone in the cemetery.</p>"
            },
