                    "#text": "WOW What A Good One Ghost - This Is Defiantly No Park And Snag - Poor Guy Apparently Nobody Liked Him Much By The Location Of This Poor Guys Final Resting Place - Found The Cache After An Extensive Search And Signed The Log - Traded Chiefs Football Helmet TB For Funny Places TB - Left One Of My Signature Monkeys Behind As A Bonus\n\nThe Cache Monkey"
