                    "#text": "Headed for an appointment in Columbia, arrived and found I had the wrong date.  Oh what else is there to do but catch up on a few caches.   Even a few showers was not enough to deter me.  Made it to GZ and studied the area - very interesting - but wet.   Found the container.  T- Round TOIT / L- Chile Pepper.\nTFTC.\nOld Professor - Tipton, Mo."
