                  "groundspeak:finder": {
                    "@id": "561623",
                    "#text": "Arthur & Trillian"
                  },
                  "groundspeak:text": {
                    "@encoded": "False",
                    "#text": "FTF! [:D]\n\nIn town to cheer on yoyoteacher while she does her first half marathon. We were at a point where we had to travel between parks when I got the email telling me of a new cache! I had never been here in Columbia when a new Columbia cache had published, save for one time at an event, so we decided to make a detour to go for it. The drive was pleasant and when we got to the area, there were no cars! I made my way to ground zero easily and had cache in hand quickly. I opened it up and was greeted by a virgin log, which I quickly deflowered with my signature. I put everything back and we zoomed of to go greet yoyoteacher at the finish line. Thanks for the cache and the fun!"
                  }
