            "groundspeak:long_description": {
              "@html": "False",
              "#text": "This is a cache in memory of my cousin Matthew Crosswhite.  He used to love coming to the Pinnacle Park and spend hours exploring.  He was known by his friends as just \"Crosswhite\".  He passed away on Feb 17 2009, suddenly, and is still missed by his family and friends.  In his honor 3 years later I am placing this cache so that Crosswhite will always be at the Pinnacles.  For the first to find there is a paracord keychain.\nThanks to Joann Cowan for permission to place the cache.\nYou are looking for a small round camo container."
            },
            "groundspeak:encoded_hints": "Top of hill by butt end of log.",
