                    "@encoded": "False",
                    "#text": "Clown Shoes and I were down this way on a Missouri Delorme run.\nWe were able to make the find here after a short search.\nStamped the log and got rollin'.\nThanks for contributing to this activity that we love.\nWe really do appreciate the effort.\n\n[orange]lagrac  Clinton Iowa!!"
