            "groundspeak:short_description": {
              "@html": "True",
              "#text": "<center>\n<p><img src=\"http://img.photobucket.com/albums/v329/Mizzou02RS/e63e586f.jpg\" /></p>\n<br />\n<b><font color=\"green\" size=\"5\">Shelving Rock</font></b></center>"
            },
            "groundspeak:long_description": {
              "@html": "True",
              "#text": "<b><font size=\"3\">Hidden within the rolling hills of Boone County and easily overlooked by passing motorists is the Pinnacles Youth Park. Even though it's not well-advertised, the wonderful geologic formations nestled within the boundaries of this park are worth a visit. Access to this treasure is found easily off U.S. 63, about 12 miles north of Columbia.<br />\n<br />\nShelving Rock lies just downstream from the namesake Pinnacles. Exploring this feature, one begins to wonder if it has been used in the past for shelter by animals or man. On special days after it has rained, numerous faucets of water emanate from the interior wall, as if Mother Nature herself chose to equip this natural domicile with plumbing.<br />\n<br />\nStreams have a tendency to erode and undercut on the outside of bends because of centrifugal force. As the water carries silt, rocks and other materials, it acts as an abrasive agent against the rock. This action, combined with solution weathering (acids and chemicals which react with minerals on the bank, especially limestone), creates erosional features such as Shelving Rock. In this case, it was formed by the constant erosional action of the waters of Silver Fork, the same stream which helped to create the Pinnacles.<br />\n<br />\nMuch like the Pinnacles, Shelving Rock is composed of the Burlington Limestone, which is approximately 300 million years old. In many areas, this is an exceptionally pure limestone and is quarried at a number of points in eastern and central Missouri and as far southwest as Springfield, Missouri. This particular kind is famous for possessing many kinds of marine fossils, particularly crinoids. This limestone is the source material for the columns of the University of Missouri-Columbia's Red Campus and Boone County's Old Courthouse.<br />\n<br /></font></b>\n<center><b><font size=\"3\"><b><font size=\"2\">SOURCE: <u>Geologic Wonders and Curiosities</u> by Thomas R. Beveridge,<br />\nSecond Edition, revised by Jerry D. Vineyard, 392 p., 163 figs., app., 1991.<br />\n<br /></font></b></font></b></center>\n<b><font size=\"3\"><b><br /></b></font></b>\n<center>\n<table border=\"3\" width=\"100%\" bgcolor=\"#000000\"></table>\n</center>\n<b><br /></b>\n<center><b><font size=\"3\">The Pinnacles Youth Park is administered by a board of directors and is patrolled by the Boone County Sheriff's Department. The park is open from 8 a.m. until dark. The gates close an hour before dark.<br />\n<font color=\"red\">Please do not put yourself and geocaching in danger by violating the hours that have been established for this park.</font></font></b></center>\n<br />\n<center>\n<table border=\"3\" width=\"100%\" bgcolor=\"#000000\"></table>\n</center>\n<br />\n<b><font color=\"green\" size=\"3\">The walk to this EarthCache is a nice and easy one, with a nice path all the way to the feature. One could probably push a stroller to this one without much issue. On the way, you'll pass other formations as well, so feel free to inspect those as well.</font></b><br />\n<br />\n<br />\n<center><b><img src=\"http://img.photobucket.com/albums/v329/Mizzou02RS/cd80a9e7.jpg\" /></b></center>\n<font color=\"green\"><font color=\"blue\"><font color=\"green\"><font color=\"green\"><br />\n<br /></font></font></font></font>\n<center>\n<table border=\"3\" width=\"100%\" bgcolor=\"#000000\"></table>\n</center>\n<font color=\"green\"><font color=\"blue\"><font color=\"green\"><font color=\"green\"><br /></font></font></font></font>\n<center><font color=\"green\"><font color=\"blue\"><font color=\"green\"><font color=\"green\"><b><font size=\"3\"><font color=\"blue\" size=\"3\">To get credit for this EarthCache, proceed to the posted coordinates. Please answer the following questions and email them to me through my profile.</font><br />\n<br />\n<font color=\"red\" size=\"4\">Any logs that do not follow these requirements will be deleted.</font></font></b></font></font></font></font></center>\n<font color=\"green\"><font color=\"blue\"><font color=\"green\"><font color=\"green\"><b><br />\n<br />\n<font size=\"3\">1. Approximately how high is the roof of Shelving Rock at its opening? At the back wall of the structure?<br />\n<br />\n2. The ceiling structure changes as you go back in. How does the ceiling's surface at the opening differ from the back?<br />\n<br />\n3. How wide would you estimate Shelving Rock to be?<br />\n<br />\n4. What is the elevation at the posted coordinates?<br />\n<br />\n5. While completely optional and not required, it would be nice to post a photo of yourself with Shelving Rock behind you.</font></b><br />\n<br />\n<br /></font></font></font></font>\n<center>\n<p><font color=\"green\"><font color=\"blue\"><font color=\"green\"><font color=\"green\"><b><font size=\"3\"><img src=\"http://img.photobucket.com/albums/v329/Mizzou02RS/OfficialECBanner.jpg\" /></font></b></font></font></font></font></p>\n<font color=\"green\"><font color=\"blue\"><font color=\"green\"><font color=\"green\"><b><font size=\"3\"><br /></font></b></font></font></font></font></center>"
            },
