                    "#text": "OCW GeoWench78 on our way to GeoCoinFest 2015 taking the scenic route to pick up some new counties and Delorme blocks in Iowa...stopped for about 90 minutes to visit this beautiful area...took the hard way up and the easy way down...that's quite a rock cut...thanks for sharing!"
