            "groundspeak:short_description": {
              "@html": "True",
              "#text": "<center>\n<p><img src=\"http://img.photobucket.com/albums/v329/Mizzou02RS/DSC00890.jpg\" /></p>\n<br />\n<b><font color=\"green\" size=\"5\">The Pinnacles</font></b></center>"
            },
            "groundspeak:long_description": {
              "@html": "True",
              "#text": "<b><font size=\"3\">Hidden within the rolling hills of Boone County lie the Pinnacles. These Sirens beckon the visitor to take heed of the wonderful geologic formations nestled within the boundaries of the Pinnacles Youth Park. Access to this treasure is found easily off U.S. 63, about 12 miles north of Columbia.<br />\n<br />\nThis slim ridge lies between two streams, Silver Fork and Kelley Branch. It was formed when Silver Fork doubled back on itself and met the parallel Kelley Branch. These streams crowded each other so closely that what remains is a precariously thin, approximately 1,000-foot ridge as an erosional remnant. One of the probable influences in this action are parallel vertical rock fracture planes that caused the streams to take the paths that they did.<br />\n<br />\nAll in all, the ridge itself doesn't have much time left, geologically-speaking, as it's only several feet wide at some points and has already been perforated a few times, leaving windows through the formation. At some point, probably in a few thousand years, either one of the streams will breach the ridge or it will collapse.<br />\n<br />\nThe Pinnacles are composed of the Burlington Limestone, which is approximately 300 million years old. In many areas, this is an exceptionally pure limestone and is quarried at a number of points in eastern and central Missouri and as far southwest as Springfield, Missouri. This particular kind is famous for possessing many kinds of marine fossils, particularly crinoids. This limestone is the source material for the columns of the University of Missouri-Columbia's Red Campus and Boone County's Old Courthouse.<br />\n<br /></font></b>\n<center><b><font size=\"3\"><b><font size=\"2\">SOURCE: <u>Geologic Wonders and Curiosities</u> by Thomas R. Beveridge,<br />\nSecond Edition, revised by Jerry D. Vineyard, 392 p., 163 figs., app., 1991.<br /></font></b></font></b></center>\n<b><font size=\"3\"><b><br />\n<br /></b></font></b>\n<center>\n<table border=\"3\" width=\"100%\" bgcolor=\"#000000\"></table>\n</center>\n<b><br /></b>\n<center><b><font size=\"3\">The Pinnacles Youth Park is administered by a board of directors and is patrolled by the Boone County Sheriff's Department. The park is open from 8 a.m. until dark. The gates close an hour before dark.<br />\n<font color=\"red\">Please do not put yourself and geocaching in danger by violating the hours that have been established for this park..</font></font></b></center>\n<br />\n<center>\n<table border=\"3\" width=\"100%\" bgcolor=\"#000000\"></table>\n</center>\n<b><br />\n<br />\n<font color=\"red\" size=\"4\">Do <u>NOT</u> attempt this EarthCache if it's been snowing or if it's icy. The terrain on top of the ridge can become quite treacherous in such conditions and people have been seriously injured from falling. I cannot stress this enough; take your time as you make your way up and be safe! We want to see you again on the caching trail.</font><br />\n<br />\n<font size=\"3\">Depending on the river conditions you might be able to cross the stream on stepping stones or using rubber boots...all else failing, you just might get your feet wet.</font><br />\n<br />\n<font color=\"green\" size=\"3\">This particular EarthCache will require you to do some work with your GPSr as you explore this treasure. First, at the posted coordinates above, take an elevation reading and record it for later. Make your way to the top of the ridge, and stop at these coordinates:</font> <font color=\"blue\"><font size=\"3\">N 39\u00ba 08.025 W 092\u00ba 19.352</font><font color=\"green\"><font size=\"3\">. Take an elevation reading here and record the information.</font><br />\n<br />\n<font color=\"green\"><font size=\"3\">Now carefully make your way back down the path from which you came and stop at these coordinates:</font> <font color=\"blue\"><font size=\"3\">N 39\u00ba 08.022 W 092\u00ba 19.378</font><font color=\"green\"><font size=\"3\">. These coordinates should put you in front of what I like to call the Picture Rock because it's a great spot for a quick snapshot. It's completely optional, but if you'd like to do just that, feel free to do so and post it here with your log.</font></font></font><font color=\"blue\"><font size=\"3\"><br />\n<br /></font></font></font></font></font></b>\n<center>\n<p><font color=\"green\"><font color=\"blue\"><font color=\"green\"><font color=\"green\"><font color=\"blue\"><font size=\"3\"><b><font size=\"3\"><b><font size=\"3\"><img src=\"http://img.photobucket.com/albums/v329/Mizzou02RS/04267a5e.jpg\" /></font></b></font></b></font></font></font></font></font></font></p>\n<font color=\"green\"><font color=\"blue\"><font color=\"green\"><font color=\"green\"><br />\n<br /></font></font></font></font></center>\n<center>\n<table border=\"3\" width=\"100%\" bgcolor=\"#000000\"></table>\n</center>\n<font color=\"green\"><font color=\"blue\"><font color=\"green\"><font color=\"green\"><br /></font></font></font></font>\n<center><font color=\"green\"><font color=\"blue\"><font color=\"green\"><font color=\"green\"><b><font size=\"3\"><font color=\"blue\" size=\"3\">To get credit for this EarthCache, please answer the following questions and email them to me through my profile.</font><br />\n<br />\n<font color=\"red\" size=\"4\">Any logs that do not follow these requirements will be deleted.</font></font></b></font></font></font></font></center>\n<font color=\"green\"><font color=\"blue\"><font color=\"green\"><font color=\"green\"><b><br />\n<br />\n<font size=\"3\">1. What is one possible influence that caused the two streams to flow so close together?<br />\n<br />\n2. Using your two elevation readings you took, subtract the first from the second. What is the approximate height of the Pinnacles?<br />\n<br />\n3. Approximately how wide is the rock window at the second waypoint?<br />\n<br />\n4. How wide and long is the top of the Picture Rock?<br />\n<br />\n5. While completely optional and not required, it would be nice to post a photo of yourself on top of the Pinnacles or with Picture Rock behind you.</font></b><br />\n<br />\n<br /></font></font></font></font>\n<center>\n<p><font color=\"green\"><font color=\"blue\"><font color=\"green\"><font color=\"green\"><b><font size=\"3\"><img src=\"http://img.photobucket.com/albums/v329/Mizzou02RS/OfficialECBanner.jpg\" /></font></b></font></font></font></font></p>\n<font color=\"green\"><font color=\"blue\"><font color=\"green\"><font color=\"green\"><b><font size=\"3\"><br /></font></b></font></font></font></font></center>\n\n<p>Additional Waypoints</p>P12PN39 - Picture Rock<br />N 39\u00b0 08.022 W 092\u00b0 19.378<br />Picture Rock<br />W12PN39 - Waypoint 2<br />N 39\u00b0 08.025 W 092\u00b0 19.352<br />Waypoint 2<br />"
            },
