            "groundspeak:short_description": {
              "@html": "True",
              "#text": "For years the kids called this place \"The Church across from the High School. The Geocache is within birds eye view of the pavilion."
            },
            "groundspeak:long_description": {
              "@html": "True",
              "#text": "This is the Oldest Tree in the area. It has shaded many church activities through the years. We anticipated it being nearly 150 years old it was so large. Count the rings. The pond obviously maximized most every year as a good growing season. Inside is a log book a description of the sponsoring organization and a few geocache coins. If the weather permits bring a sack lunch, or a fishing pole and catch your own lunch! You are welcome to sit and enjoy the tranquility. Permission was obtained from TLCC's board of Elders to place this cache."
            },
