                    "#text": "In anticipation of November Ghost's 500th cache find, we set out on a mini-trip to Centralia with the geo-pibble in tow. After caching in Centralia, we meandered back towards Columbia. Always enjoy finding an ammo can. We left some swag and a TB. Cache on!"
