                    "#text": "on a Sunday outing with wrenberlin and the geo-pibble so I could get my 500th cache brought us to some small towns in Mid-Missouri ... as always a thrift shop and abandoned building to explore were part of the day! \n\nthis was a nice find for us ... it showed TBs at this cache, but no such luck, so I left one for the next cacher! it is nice to see ammo cans out there! TFTC!"
