            "groundspeak:short_description": {
              "@html": "True",
              "#text": "<p>This is a multi stage cache. The first one will lead you to a place with an island. After finding the cache, it will take you to a place which is flowing and falling during the spring and summer months. After flowing the clues, it will be the best one in Moberly.</p>"
            },
            "groundspeak:long_description": {
              "@html": "True",
              "#text": "<p>This is a multi stage cache experience. It will first take you to one of Moberly's most beautiful parks. Park your car and take a small walk to rest your rear end. Sit by the King and take it all in. Do not forget to look up and around to find a small key box. Once you find it, the words will be scrammbled and locked. Use the key to unlock it's wonder. It will take you to a place near the courts where some people make blunder. Follow the words from the wonder to find the cache. On the edge is where you will find this nice big stash. </p>\n\n<p> </p>\n<p>Additional Waypoints</p>FN66WAJ - Final Location<br />N 39\u00b0 25.066 W 092\u00b0 27.669<br />It is a clear large cylinder container, with the Geocaching description on it.<br />P066WAJ - Hear me Roar!<br />N 39\u00b0 24.582 W 092\u00b0 27.101<br />Park close by and walk a short way to rest your rear end. Have a seat, to beat the heat; but remember to look up my friend.<br />"
            },
            "groundspeak:encoded_hints": "At the end, it is near one of \"TLC's\" most famous songs.",
