                    "#text": "Out caching solo on a pleasant Monday, picking up a couple FTF's in the Moberly area. \n\nThe main goal of the day was to simply enjoy myself doing what I really love doing...caching! Along the way, though, any cacher worth their salt would take in the awesome sights, which is exactly what I did! I gotta say, this area of the state is quite beautiful! I was not alone, having the spirits of cachers past tagging along, which added to the fun. Okay, I was kidding about the last part, LOL.\n\nThis cache was one of the caches I had the privilege of finding. Thanks for placing this cache for everyone, myself included, to enjoy! TNLN/SL TFTC!\n\nYes, we know where our towels are...\n\n-Fulton, MO"
