                    "#text": "Cheers  & Thanks,\n\nCongratulations  on this addition to geocaching in your area. \n[Red]\nAll future finders and I appreciate you getting the required permission. [/Red]\n\nGlenn \n\"Seek quality, not quantity\".\n--\nYour friendly Missouri Geocache Review team is:\nGlenn (*gln) http://www.geocaching.com/profile/?u=*gln ,  Mongo http://www.geocaching.com/profile/?u=Mongo & Banjo-Boy http://www.geocaching.com/profile/?u=Banjo-Boy\nHow to get your cache published quickly: http://tinyurl.com/yhnva3g \n\nDave's Handy Hiding Hints (READ THESE)  http://slaga.org/caching-tools/tools-and-info/67-daves-handy-hiding-hints.html\n\nDecember 7, 2015 11:40 AM by *gln"
