                    "#text": "436-649  Favorite.  Out caching with Trekto on Out Of Town Tuesday.  Today we traveled to Moberly Missouri and Mexico Missouri.  We picked up over 20 caches with only one DNF.\nWe stopped at each and every cache and signed each and every log.  Thanks to all of the CO's for placing these caches.\n\nRainman"
