            "groundspeak:long_description": {
              "@html": "True",
              "#text": "<p>This cache is part of the Peanuts Gang series in Rothwell Park and Lion's Beuth park. I have chosen the area because there is many areas you can park and still get to more than one cache by walking and then can get back into your vehicle and park again to get the next set of caches. You can also if you want walk or bike the nice trails in the area to get to most of the caches. There are also many things to do in the park, plan to bring the family and stay for more enjoyment after your cache adventure that will take you to many areas of the park including around the lake which will give you good views. If you do bring your kids please watch them when around vehicle used areas and the lake caches are not next to the water and you will have several feet if they get away from you. Most to all the cache should not take long to find depending on your expertise.V1p3rx and I have worked to make the series fun and not finding the same old thing over and over. You will find a couple different styles of hides and also one that is maybe not be the expected way to retrieve the cache from the rest of the series. Stealth may be required due to being close to trails, or areas people may visit. We have attempted to give you geocover in all areas but it is a park. Please make sure the cache is hidden well when you place it back into its hiding spot. There is a archery range in the area so use caution even though caches are not placed in the area of the archery. Hope you enjoy the area and caches available in the park and this series. \u00a0\u00a0</p>\n<p>Charles (Sparky) Monroe Schulz was born on November 22nd, 1922 in Minneapolis, Minnesota, but grow up in St. Paul Minnesota at the age of 77 he passed away on February 12<sup>th</sup>, 2000 in Santa Rosa, California. Schulz first comic strip was called <em>Li\u2019l Folks and ran from June 1947-January 1950 in the</em> St. Paul Pioneer Press. In Li\u2019l Folks was the first time Schulz used the name Charlie Brown and he created a dog that also looked much like Snoopy. In May of 1948 Schulz sold the first of his one panel drawing to The Saturday Evening Post. After his Li\u2019l Folks comic strip was dropped in the 1950\u2019s, Schulz went to United Feature Syndicated with the one panel Li\u2019I Folks. Interested in his one panel comic, However Schulz had developed a normal four panel strip and at that time and United Feature Syndicated became interested and decided to publish a four panel comic. Peanuts made its debut on October 2<sup>nd</sup>, 1950, in seven different newspapers. The popular weekly Sunday page made its first appearance on January 6<sup>th</sup>, 1952. When the Peanuts comic strip was on top, it was published every day in 2,600 papers in 75 countries, 21 languages. In almost 50 years the Peanuts comic strip was produced Schulz drew nearly 18,000 strips. Between the comic strips, merchandise, product endorsement produced revenues of more than 1 billion per year. Schulz\u2019s estimated earrings was 30-40 million annually. The Peanuts comic strip only once why Schulz was alive have reshowings when Schulz went on vacation for five-weeks to celebrate his 75<sup>th</sup> birthday. Schulz never had assistants creating the strip and refused to hire an inker or letterer. On December 14<sup>th</sup> 1999 Schulz announced his retirement due to having several small strokes and a blocked aorta. It was later discovered he had colon cancer that had metastasized. Once Schulz started chemotherapy he was unable to see clearly. Schulz on February 12<sup>th</sup>, 2000 died in his sleep around 9:45 P.M. from colon cancer. The last original Peanuts comic strip was produced the next day on Sunday, February 13<sup>th</sup>. Charles Monroe Schulz is buried in Pleasant Hill Cemetery in Sebastopol, California.</p>\n<p>Franklin Armstrong Was introduced July 31<sup>st</sup>, 1968 as the first black charter in the comic strip. His last appearance was November 5<sup>th,</sup> 1999 until he appeared in The Peanuts Movie on November 6<sup>th</sup>, 2015. He went to school with Peppermint Patty and Marcie in his first story, Charlie Brown and Franklin meet on the beach. His father was a solder in the Vietnam War.\u00a0 Franklin was introduced to the peanuts gang when a Los Angeles school teacher named Harriet Glickman wrote Schultz in the spring of 1968 asking him to bring a black character to the comic strip. His last name is consider a apocryphal because the only time his last name is talked about is in the T.V. special you\u2019re in the Super Bowl, Charlie Brown. He is only referred as Franklin in the Comic Strip and other T.V. specials.\u00a0</p>\n<p>When Geocaching please respect and follow the rules of the park.</p>\n<p>The Park is open to the public daily from 5:00 a.m.-11:00 p.m.</p>\n<p>Do not damage any of the parks property, tress, or other wildlife.</p>\n<p>Hope you enjoy the park and its amenities.\u00a0\u00a0</p>"
            },
