            "groundspeak:short_description": {
              "@html": "True",
              "#text": "<p>THIS GEO CACHE WAS PLACED TO REMEMBER JOHN BRENNEMAN.A CO-WORKER AT MOBERLY REGIONAL MED CENTER LOCATED IN MOBERLY MISSOURI, IT IS A SMALL CACHE. \u00a0PARK AND GRAB. \u00a0IT IS LOCATED BY A TREE THAT WAS PLANTED IN HIS MEMORY. \u00a0JOHN WAS TAKEN AWAY TOO SOON BY A DRUNK DRIVER ON MARCH 11, 2014.</p>\nthis cache has permission for7/24 entry"
            },
            "groundspeak:long_description": {
              "@html": "True",
              "#text": "<p><strong>JOHN MATTHEW BRENNEMAN</strong></p>\n<p>SEPT. 15,1975 \u2013 MAR. 11,2014</p>\n<p>\u00a0</p>\n<p>John was born into a family with an older sister Julie, an older brother Jay and\u00a0 two surprised parents Jim and Judy.\u00a0 We thought Judy had the flu, not morning sickness.\u00a0 Given the family tradition, unknowingly established, his first name would have to start with \u201cJ\u201d thus John.</p>\n<p>\u00a0</p>\n<p>John was born and raised in the small town of Santa Maria CA.\u00a0 He attended Miller Street School for Kindergarten, 1<sup>st</sup> and 2<sup>nd</sup> Grades.\u00a0 He started 3<sup>rd</sup> Grade at St. Mary's Catholic School through the 6<sup>th</sup> Grade.\u00a0 Then attended Fesler Junior High School for the 7<sup>th</sup> and 8<sup>th</sup> Grades and onto St. Joseph High School for four years and Graduation in 1993.\u00a0</p>\n<p>\u00a0</p>\n<p>John was a good boy and was not a hard one to raise, but he did have his moments.\u00a0 When he was three or four he walked through the living room carrying a screw driver toward his room.\u00a0 When asked why he replied he was going to take apart his sit and spin. Which he did.\u00a0 Reassembly was performed later by Dad.\u00a0 He liked to see how things worked and had an aptitude for mechanical and electrical work.</p>\n<p>\u00a0</p>\n<p>John enjoyed sports and excelled as a Junior Bowler and attended State tournaments with his friends on Rancho Bowl teams.\u00a0 After he grew up and left home he almost always had two bowling balls in the trunk of his car, in case a bowling opportunity materialized.\u00a0 He took up throwing the Discus in High School and in his Senior year he went to the California Southern Section CIF finals to qualify for the state tournament and missed qualifying by one slot, they took 9 throwers and John finished 10<sup>th</sup> with his best throw of the season.</p>\n<p>\u00a0</p>\n<p>John was a great person and devoted to his friends and family.\u00a0 He was not lucky in love.\u00a0 He wanted the dream, but the women he chose did not. He stayed for 5 years with the first love and finally ended it with no children.\u00a0 He then married a woman with 3 children and was happy to act as their father for 9 years.\u00a0 Kayla, Alexis and Kenneth (Bubba) Smart were very much loved by John, and were placed with their biological Dad after his second divorce.\u00a0 However he did get full custody of his children from that marriage , Emily and Matthew.\u00a0 His greatest joy was the successes of all 5 of the children and he enjoyed sharing their stories.</p>\n<p>\u00a0</p>\n<p>John joined the Army in May of 1999, not wanting to go to college at the time, but looking for training he could use in life, plus the benefits of college subsidies he could use later.\u00a0 He went to a 9 month Medical Equipment Course and was the honor graduate.\u00a0 Because of his ability to assimilate and retain information, he was able to not only utilize his high school education to advance him in his class, but also to tutored others who were struggling.\u00a0 John was sent to Kuwait and then into Iraq as a part of the invasion force in 2003.\u00a0 He left the Army with an honorable discharge in May 2005, because he did not want to be separated from his family in the future.</p>\n<p>\u00a0</p>\n<p>John then moved his family from his last Military duty station in San Antonio, TX to Columbia, MO, where he worked for Modern Biomedical Services, Inc. in support of the Moberly Regional Medical Center (MRMC).\u00a0 He was a Bio-Medical Technician there, repairing and maintaining medical equipment within the hospital complex.\u00a0 He loved his job and the people he worked with both within Modern Biomedical and MRMC.\u00a0</p>\n<p>\u00a0</p>\n<p>The friends he met through work and outside work, in his community, were important to him and he was always willing and able to lend a helping hand when needed.\u00a0 He loved to coach discus and found a small school that could use his help.\u00a0 He also helped coach his children's teams as they began playing</p>\n<p>sports.\u00a0 He was active in helping his children succeed in school and placed a heavy emphasis on the importance of school in them.</p>\n<p>\u00a0</p>\n<p>While the help he provided to others was part of his legacy, their help in working him through the rough parts of his life was also\u00a0 important. The people that knew him always describe him as happy and cheerful to all.\u00a0 He was moving his life into a better place after his last divorce and his positive attitude was shining through.\u00a0 It was a tragedy when a drunk driver, going the wrong way on a divided highway, ended his young life on 11 March 2014.\u00a0</p>\n<p>\u00a0</p>\n<p>John made the world around him a better place while he was here and no one can ask more than that.</p>\n<p>\u00a0</p>\n<p>\u00a0</p>"
            },
