                    "#text": "In anticipation of November Ghost's 500th cache find, we set out on a mini-trip to Centralia with the geo-pibble in tow. After caching in Centralia, we meandered back towards Columbia. We stopped off in Moberly to do a bit of thrifting, and found this cache along the way. I used to be a cemetery tour guide, and we like to say that one doesn't truly die until the last time their name is uttered. We spoke his name at the cache to keep his memory alive. TFTC!"
