                    "#text": "I think there must be one of these types of caches in every town. I guessed what type it would be by looking at a map. I spotted the hiding place from over a mile a way, but there were lingering muggles everywhere. Eventually, there were just two, workers who seemed more intent on cleaning out the beer bottles and cans from the back of their truck than trying to figure out what I was doing. This was by far the noisiest and most difficult of all of it's type that I've tried to retrieve. It really added character and challenge to the cache."
