                  "groundspeak:finder": {
                    "@id": "2014312",
                    "#text": "Old Professor"
                  },
                  "groundspeak:text": {
                    "@encoded": "False",
                    "#text": "I guess I get the FTSTNL (First To Sign The New Log) award.  We were on a run to the Central Christian College of the Bible Book Store today, so that made for a good time to pick up a few caches in the Moberly area.  The wife was finishing up her Christmas list.   Good use of the description and the hints.  We were able to make the grab and get log signed.  TFTC.  \nOld Professor - Tipton, Mo."
                  }
