                    "#text": "Woo-Hoo! #3 (2:04 PM)\n\nSetting sights north, Atomic Goat's Breath and I had a decision to make once in Macon:  east or west?  East was chosen as the route would loop nicely around to other caches we intended to attempt.  Before long, we were in Ten Mile and nimbly seeking the hidden container.  Goat made the find and shared the log.  Once back in place, we returned to the road and further adventures to the west!\n\nTook nothing, left nothing."
