                    "#text": "Late Logging; Catching up on some older logs....\nCribbage witch mentioned that the container I  found appeared to be the original, Although I don't think it was in the correct spot and it was a REACH to get it.  Where I think was supposed to be - was filled with ants.\n\nWas in the area with Cribbage Witch - On our frequent route from St. Louis to St Joseph Area and back through KC to visit with the Folks in Maysville and the kids in KC.  We decided to pick up a few caches to give ourselves time to stretch.    Even though the trip was about double the length, Geocaching seemed to make it feel it went twice as fast.    Thanks for putting these out to make our trip more enjoyable today."
