                    "#text": "Road Trip to Peoria and Points West Geo-Excursion\n\nScrapLadyS needed a ride-along buddy to go see her son pitch some college baseball, so what better than to make it a georoad trip?  We planned a few dozen caches, but time and distance prevented us from doing all of them.  No worries.  Better to have too many than too few.  This cache was one that we picked up during the weekend.  Thank you for placing it!\n\nSome of these may be logged out of order due to some weird happening with the app.  They aren't in order there.  O.o"
