                  "groundspeak:text": {
                    "@encoded": "False",
                    "#text": "November Ghost and myself + the geo-pibble decided this Saturday was a good day to find a cache in the great state of Iowa. Yes, that would be the same day a snowstorm was predicted to blow through. Despite logic, our adventurous streak prevailed, and we left from Columbia, MO, early in the day to visit Ottumwa, IA, where November Ghost has family roots. Ottumwa is quite charming! I learned how delicious a canteen lunch is while overhearing the locals discussing the brewing snow. Still un-phased by the talk of ferocious flurries, we spent the afternoon finding many fine caches. Our trip included a visit to Ghost\u2019s past and a test of courage involving climbing up the slippery branches of a tree in the rain. You bet we exchanged some high fives after tackling that one. Around 5 or 6, it finally dawned on us that there was supposed to be some inclement weather on the way. Still, we dilly-dallied at a diner before finally getting out on the road as the sun was setting. Did I mention that I\u2019m from the south, and that I\u2019d never driven through snow before? November Ghost was behind the wheel\u2026 but that doesn\u2019t mean he could actually see the road. And neither could I. I don\u2019t think I\u2019ve ever been that terrified due to weather. Now I know what those bumps on the sides of the lane are for! Driving blind proved to be much too stressful, so we stopped in Kirksville, MO for the night (and I found my first cache in the snow!) We made it home safe and sound on Sunday morning, and with a hearty respect for Mother Nature. Many thanks to all of the cachers who placed the hides we found on our trip!\n\nSunday morning, I woke up to a lovely blanket of snow and took the geo-pibble for a walk in it. Turns out, she loves snow! After a morning meetup at the golden arches for coffee, November Ghost and I took the jeep out to make some fresh tracks through the field of white. This park-n-grab was a fun find today. Thanks!"
                  }
